import React from "react"
import Head from "./Head.js"
import ChooseMenu from "./ChooseMenu.js"
import 'bootstrap/dist/css/bootstrap.min.css';
import "./style.css"
import { Collapse } from "react-bootstrap";

class App extends React.Component {
  constructor(props){
    super(props)
    this.state={
      homemenustart:false,
      homemenu:false
    }
  }
  sethomemenu(event){
    this.setState({homemenustart:event})
    this.setState({homemenu:event})
  }
  render() {
    return (
      <body >
        <div padding="0px">
          <Head/>
          <Collapse in={this.state.homemenu}>
            <div className="card"><ChooseMenu/></div>
          </Collapse>
          <Collapse in={!this.state.homemenustart}>
            <card>
              <div className="center">fasf</div><br/>
              <button 
              onClick={()=>this.sethomemenu(!this.state.homemenustart)}
              className="btn btn-lg btn-outline-success menustartcss"
              >start
            </button>
            <div className="homemenu"></div>
            </card>
          </Collapse>
        </div>
        <footer className="footer center">
          <p>Made By <a href="ChooseMenu" target="_blank">Title Tawan.</a></p>
        </footer>
      </body>
    )
  }
}

export default App;
